import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Parking = ({ location }) => {
  const [parkingLocations, setParkingLocations] = useState([]);

  useEffect(() => {
    const fetchParking = async () => {
      const response = await axios.get(
        `https://maps.googleapis.com/maps/api/place/textsearch/json?query=parking+in+${location}&key=YOUR_API_KEY`
      );
      setParkingLocations(response.data.results.slice(0, 5)); // Get top 5
    };

    fetchParking();
  }, [location]);

  if (!parkingLocations.length) return <p>Loading parking locations...</p>;

  return (
    <div>
      <h2>Top 5 Parking Locations in {location}</h2>
      <ul>
        {parkingLocations.map((place) => (
          <li key={place.place_id}>{place.name}</li>
        ))}
      </ul>
    </div>
  );
};

export default Parking;
